  [],\n\t\"title\": \"The StreamCat Dataset: Accumulated Attributes for NHDPlusV2
  Catchments (Version 2.1) for the Conterminous United States: 2010 US Census Housing
  Unit and Population Density\",\n\t\"tracking_summary\": {\n\t\t\"total\": 7,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-09-24T15:28:29.646588\",\n\t\"name\": \"the-streamcat-dataset-accumulated-attributes-for-nhdplusv2-catchments-version-2-1-for-the-conte9b184\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents the population
  and housing unit density within individual, local NHDPlusV2 catchments and upstream,
  contributing watersheds based on 2010 US Census data. Densities are calculated for
  every block group and watershed averages are calculated for every local NHDPlusV2
  catchment(see Data Sources for links to NHDPlusV2 data and Census Data). This data
  set is derived from The TIGER/Line Files and related database (.dbf) files for the
  conterminous USA. It was downloaded as Block Group-Level Census 2010 SF1 Data in
  File Geodatabase Format (ArcGIS version 10.0). The landscape raster (LR) was produced
  based on the data compiled from the questions asked of all people and about every
  housing unit. The (block-group population / block group area) and (block-group housing
  units / block group area) were summarized by local catchment and by watershed to
  produce local catchment-level and watershed-level metrics as a continuous data type
  (see Data Structure and Attribute Information for a description). Using a riparian
  buffer(see Process Steps), statistics were generated for areas within each catchment
  that are within 100 meters of the stream reach in an attempt to evaluate for the
  riparian zone.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
